import { Header } from "../../components/Header";
import { Form } from "../../components/Form";
import { List } from "../../components/List";

export const Dashboard = ({ checkLogged }) => {
  <>
    <Header checkLogged={checkLogged} />
    <main className="container main__container">
      <Form addTransactions={addTransactions} listForRender={listForRender} />
      <List
        listForRender={listForRender}
        rmvTransaction={rmvTransaction}
        filterTransactions={filterTransactions}
      />
    </main>
  </>;
};
